from collections import Counterclass Solution:    def wordSubsets(self, A, B):        """        :type A: List[str]        :type B: List[str]        :rtype: List[str]        """        res,dictb=[],{}        for itemb in B:            temp = Counter(itemb)            for key,val in temp.items():                if key not in dictb or dictb[key]<val:                    dictb[key]=val        for item in A:            dicta=Counter(item)            index=1            for key,val in dictb.items():                if key not in dicta or dicta[key]<val:                    index=0                    break            if index:                res.append(item)        return ress=Solution()A = ["amazon","apple","facebook","google","leetcode"]B = ["e","o"]print(s.wordSubsets(A,B))